import {Routes, Route, Navigate} from "react-router-dom";

import Home from "../pages/Home/Home";
import Spacecrafts from "../pages/Spacecrafts/Spacecrafts";
import SpacecraftBuild from "../pages/SpacecraftBuild/SpacecraftBuild";
import Spacecraft from "../pages/Spacecraft/Spacecraft";
import Planets from "../pages/Planets/Planets";

function AppRoute ()
{
  return (
      // todo render routes
      <Routes>
        <Route
          path="/"
          element={<Home />}
        />

        <Route
          path="/spacecrafts"
          element={<Spacecrafts />}
        />
        <Route
          path="/spacecraft/build"
          element={<SpacecraftBuild />}
        />
        <Route
          path="/spacecraft/:id"
          element={<Spacecraft />}
        />

        <Route
          path="/planets"
          element={<Planets />}
        />

        <Route
          path="*"
          element={<Navigate to={"/"} />}
        />
    </Routes>

  );
}

export default AppRoute;
